import logo from './goodlogo.png';
import './App.css';
import React from 'react';

function App() {
  return (
    <div class="backround">
        <header>
            <nav>
                <img src={logo} alt="Better Notes Logo" className="logo" />
                <ul>
                    <li>
                        <a href="about.html">Benefits</a>
                    </li>
                    <li>
                        <a href="login.html">Log In</a>
                    </li>
                </ul>
            </nav>
        </header>
        <div class="title">
            <h1>Better Notes</h1>
            <h2>We use Ai to help student stay organized and take better notes</h2>
        </div>
        <div class="signup">
            <Button />
        </div>
    </div>
  );
}

function Button() {
    const handleClick = () => {
        alert('CLICKED ME');
    };

    return (
        <button className="button" onClick={handleClick}>
            Sign Up
        </button>
    );
}



export default App;
